import React from 'react';
import logo from '../../images/Logo.svg'
import './Header.css'

const Header = () => {
    return (
      <div>
            <nav className='header'>
                <img src={logo} alt="" />
                <div>
                    <a href="">Shop</a>
                    <a href="">Orders</a>
                    <a href="">Inventory</a>
                    <a href="">About</a>
                </div>
        </nav>
      </div>
    );
};

export default Header;
